const seen = new Set();
const filtered = [];

for (const item of items) {
  const urls = item.json.urls;
  if (!urls) continue;

  // Siempre iteramos sobre un array
  const list = Array.isArray(urls) ? urls : [urls];

  for (let url of list) {
    if (typeof url !== 'string') continue;

    // descartar enlaces basura
    if (
      url.includes('unsubscribe') ||
      url.includes('help') ||
      url.includes('privacy')
    ) continue;

    // solo dominios medium.com con perfil @
    if (!url.startsWith('https://medium.com/@')) continue;

    // limpiar cola de parámetros (? y ----...)
    let cleanUrl = url.split('?')[0];           // quita desde la primera ?
    cleanUrl = cleanUrl.replace(/----.*$/, ''); // quita extras "----..."

    // validar que tiene exactamente 3 segmentos tras medium.com
    const parts = cleanUrl.replace('https://', '').split('/');
    // ["medium.com", "@usuario", "titulo-articulo-id"]
    if (parts.length === 3) {
      if (!seen.has(cleanUrl)) {
        seen.add(cleanUrl);
        filtered.push({ json: { url: cleanUrl } });
      }
    }
  }
}

return filtered;

let rawHtml = $json.html;

// Limpiar comillas escapadas y slashes escapados
let cleanHtml = rawHtml
  .replace(/\\"/g, '"')
  .replace(/\\\//g, '/');  // convierte https:\/\/ en https://

// Devolver como html válido para el siguiente nodo
return {
  json: {
    html: cleanHtml
  }
};

